import React from "react";

export function Login({ goSignup }) {
  return (
    <div className="bg-white shadow-lg rounded-2xl p-8 w-full max-w-md">
      <h2 className="text-2xl font-bold mb-6">Login</h2>

      <form className="space-y-4">
        <input type="email" className="w-full p-3 rounded-xl border" placeholder="Adresse email" />
        <input type="password" className="w-full p-3 rounded-xl border" placeholder="Mot de passe" />

        <button className="w-full p-3 bg-blue-600 text-white rounded-xl font-semibold">
          Submit
        </button>
      </form>

      <p className="mt-4 text-sm text-center">
        Don't have an account?{' '}
        <button onClick={goSignup} className="text-blue-600 font-semibold">
          Sign up
        </button>
      </p>
    </div>
  );
}
